description:
La Société Algérienne de Distribution de l’Électricité et du Gaz, dénommée « SADEG. Spa », société par actions et dont le siège social est situé au niveau de l’immeuble 500 bureaux- Route nationale n°38- Gué de Constantine- Alger, gère à travers ses cinquante-trois (53) Directions de Distribution, 48 concessions électricité et gaz s’étendant sur le territoire national. De par ses missions et attributions, la SADEG met au service de ses clients pas moins de 187 Districts Électricité et 186 Districts Gaz ainsi que 378 agences commerciales.

Les missions et attributions de La Société Algérienne de Distribution de l’Électricité et du Gaz sont : 
- Adapter le réseau d’aujourd’hui aux nouvelles technologies de demain afin de rester en adéquation permanente avec les besoins des clients ;

- Sécuriser les infrastructures vis-à-vis d’une part, de l’évolution des consommations, en particulier la consommation électrique (capacité du réseau et des postes sources, sécurisation des lignes aux aléas climatiques), et d’autre part, de la croissance de la production et les accidents de grande ampleur ;

- Accompagner et réaliser, dans le cadre du programme de l’Etat, les projets de développement, conformément aux missions de la Société.
- Satisfaire aux meilleures conditions la demande de raccordement des clients électricité et gaz ;

- Contribuer à bâtir une politique sociale en cohérence avec nos valeurs et nos objectifs.

Laboratoires Salem est une entreprise familiale née en 1994. Elle s’investit dans l’industrie pharmaceutique privée en Algérie.

Les laboratoires SALEM produisent des médicaments , des dispositifs médicaux et des compléments alimentaires. Actuellement, ils exploitent plus de 70 AMM sur deux sites industriels (El Elma et Sétif) répondant aux normes internationales.

Les laboratoires SALEM disposent d’une équipe pluridisciplinaire, de plus de 300 employés de haut niveau : pharmaciens, chimistes, ingénieurs biologistes et médecins jouissant, d’une compétence galénique et réglementaire.


Exploitation:
Importation et distribution de médicaments et de dispositifs médicaux;
Exportation vers différents marchés africains;
Pharmacovigilance et pharmacovigilance;

Production:
Fabrication de médicaments génériques, dispositifs médicaux et compléments alimentaires); 
Certification: BPF, ISO 9001, ISO 13485;


Recherche & Développement :
Développement de nouveaux produits;
Prestation de développement de produits aux tiers;

Fondée en 2016, Paps est une entreprise sénégalaise qui évolue dans la logistique de bout en bout. Nous proposons des solutions innovantes aux entreprises et aux commerçants pour assurer la distribution de documents et de colis partout dans le Sénégal, dans la sous région et à l’international.
Nos services :
Ramassage immédiat ou programmé de colis et de courriers ;
Stockage de marchandises dans un entrepôt sécurisé et aux normes ;
Livraison de colis assurés en point relais ou en last miles, à partir de 1.000 Francs ;
Services professionnels : gestion et reversement de cash on delivery, mise à disposition de coursiers, gestion des retours, recouvrement & reporting périodique.
Nos prestations sont basées sur l'utilisation des technologies de l'information et de la communication afin de répondre aux problématiques d’adressage en Afrique.
